script: |
  super -f text -I q9578.spq | sort > q9578.out

inputs:
  - name: q9578.spq
    data: |
      SELECT + 78 FROM tab2 (FORMAT parquet) cor0 WHERE + col2 NOT BETWEEN NULL AND - 89 * + + col2 * + col1 + - col0;
  - name: tab2

outputs:
  - name: q9578.out
    data: |
      78
      78
      78
